import { Link } from "react-router-dom";

const DoctorLogin = ()=>{
    return(
        <div>
            <Link to="/patientlogin">Are you a Patient</Link>
            <h4 className="opacity-75">Doctor Login</h4>
            <form className="col-sm-10">
                <p className="opacity-50">Doctor Email ID</p>
                <input className="form-control" type="Email" placeholder="Enter Email ID" /><br/>
                <p className="opacity-50">Doctor Password</p>
                <input className="form-control" type="password" placeholder="Enter Password" /><br/>
                <div>
                    <button type="Submit" className="btn btn-primary">SUBMIT</button>
                </div>                               
            </form>          
        </div>
    );
}

export default DoctorLogin;
